өкурөгумдөн\n\nКуплет 2:\nДо нашего знакомства\nЯ был бессердечным,\nВстретив ее сразу \nЯ потерял дар речи\nНежный голос шепчет\nОбнимая плечи,\nЯ думал, что навечно ,\nА ты считала встречи\nЗапах твоих локон,\nМеня торкало до МАННА\nсекунда за секундой\nСтановился наркоманом.\nНе смог стопанутся,\nТы стала марихуаной\nДля меня и даришь туманы \nРастаману\nТы мой воздух и я дышу тобой\nТы моя муза кислая , моя любовь и боль\nПусть накроет волной, холодной зимой ты будь рядом со мной, моя любовь \nМою любовь к тебе, никогда не потушить\nОна горит внутри и она хочет жить,\nЯ знаю что отпускаю тебя навсегда \nМне бы главное чтоб ты была счастлива \n\nПереход:\nТы подарила мне любовь а затем и боль \nТы рассыпала сахар а затем и соль\nТы раскидала миллион а затем и ноль\nПосветила ты себя, но не тому герою\n\nПрипев:\nМенин ойлорумда сенин атың чөгуп калды, жана жүрөгүмдө\nМенин жүрөгүмдөн абдан жылуу оорун алдың, жана көкурөгумдөн\n___________________\n#curltai #liveshow #liveperformance #richflex  #Bakr #бакр #бакройлорумда","commandRuns":[{"startIndex":159,"length":23,"onTap":{"innertubeCommand":{"clickTrackingParams":"COMCEM2rARgBIhMIrrWbyaLcgQMVMNZPCB0gxQ1hSIin5KPGkt3_4gE=","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbXQ1eDNaSGgzOTNxeE01WnpkRHBiNUlIVUlpd3xBQ3Jtc0trRVlpNElsbGVOUWFEMUwwcXN3REF4MEJENVRGX2FDbk5WMVRRNHo0c1k1Vk8zOG93MUZvNTNKM1dJdXJPbk1qVDNXSGE1TDRiNzdHLXc3dzZNbkctM0lScGFnX19rSHhTNjlqejBKMnVnYTlJdXdncw\u0026q=https%3A%2F%2Fband.link%2FaTfgs\u0026v=4v90lGR5E4g","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbXQ1eDNaSGgzOTNxeE01WnpkRHBiNUlIVUlpd3xBQ3Jtc0trRVlpNElsbGVOUWFEMUwwcXN3REF4MEJENVRGX2FDbk5WMVRRNHo0c1k1Vk8zOG93MUZvNTNKM1dJdXJPbk1qVDNXSGE1TDRiNzdHLXc3dzZNbkctM0lScGFnX19rSHhTNjlqejBKMnVnYTlJdXdncw\u0026q=https%3A%2F%2Fband.link%2FaTfgs\u0026v=4v90lGR5E4g", i.music.\n\n#bakr\n#ойлорумда\n\n⚔️ подписываемся на официальные страницы:\n\n  / bakr.xs  \n  / dok.dail     / curltai.music  \n\n🚀 \"straight out from bakai-ata\"\n__________________\nТекст:\nПрипев:\nМенин ойлорумда сенин атың чөгуп калды, жана жүрөгүмдө\nМенин жүрөгүмдөн абдан жылуу оорун алдың, жана көкурөгумдөн\n\n1 куплет:\nПри виде тебя меня банчит приходка,\nИ твоя кислая походка разрывает,\nЖжет меня - добивает плотно\nБез четно прямо до глотки\nОна ноты “ДО РЕ МИ” и мы синонимы\nНочами мы бессонными ,где-то унесенными\n\nПрипев:\nМенин ойлорумда сенин атың чөгуп калды, жана жүрөгүмдө\nМенин жүрөгүмдөн абдан жылуу оорун алдың, жана көкурөгумдөн\n\nКуплет 2:\nДо нашего знакомства\nЯ был бессердечным,\nВстретив ее сразу \nЯ потерял дар речи\nНежный голос шепчет\nОбнимая плечи,\nЯ думал, что навечно ,\nА ты считала встречи\nЗапах твоих локон,\nМеня торкало до МАННА\nсекунда за секундой\nСтановился наркоманом.\nНе смог стопанутся,\nТы стала марихуаной\nДля меня и даришь туманы \nРастаману\nТы мой воздух и я дышу тобой\nТы моя муза кислая , моя любовь и боль\nПусть накроет волной, холодной зимой ты будь рядом со мной, моя любовь \nМою любовь к тебе, никогда не потушить\nОна горит внутри и она хочет жить,\nЯ знаю что отпускаю тебя навсегда \nМне бы главное чтоб ты была счастлива \n\nПереход:\nТы подарила мне любовь а затем и боль \nТы рассыпала сахар а затем и соль\nТы раскидала миллион а затем и ноль\nПосветила ты себя, но не тому герою\n\nПрипев:\nМенин ойлорумда сенин атың чөгуп калды, жана жүрөгүмдө\nМенин жүрөгүмдөн абдан жылуу оорун алдың, жана көкурөгумдөн\n___________________\n#curltai #liveshow #liveperformance #richflex  #Bakr #бакр #бакройлорумда","commandRuns":[{"startIndex":159,"length":23,"onTap":{"innertubeCommand":{"clickTrackingParams":"CCcQ040EGAMiEwiutZvJotyBAxUw1k8IHSDFDWFIiKfko8aS3f_iAQ==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbVhMN2t1ZkQxcmdvZU5ncExC
